        "|<emoji document_id=5449523005598210324>🌲</emoji>|<emoji document_id=5370874247373660919>💸</emoji><emoji document_id=5190406357320216268>🦠</emoji>|-[<emoji document_id=5323735495241377106>🐊</emoji>]-<emoji document_id=5379716300840902598>💚</emoji><emoji document_id=5238108342873762772>🦎</emoji>⟩ϮƀӀ ϯƴϯ đѧʙѧӣ ʍʜє ҁʌєӡƀӀ ʜє πƴҁκѧӣ џѣѳ ᴙ ҁʙѳџʍ ӌʌєʜѳʍ ѣƴđƴ πⱀѳѣџʙѧϯƀ ϯʙѳӣ ϯƴχʌƀӀӣ ʍѳӡґ ҁ κѳϯѳⱀѳґѳ ʌƀєϯҁᴙ ѣѳʌѳϯҵє ʜƴ џ κѳʜєӌʜѳ ʍѳє đєⱀƀʍџѱє κѳϯѳⱀѳє ϯƀӀ ҁχѧʙѧєɯƀ ӡѧ ʍџʜƴϯƀӀ єѣƴӌѧᴙ πҁџʜѧ. ⴼƴ ϯƀӀ џ ɯѧʌѧʙѧ ѣєӡӡƴѣѧᴙ ᴙ ϯє ʜѧχƴӣ ʍѧϯєⱀƀ ϯƴϯ ѣƴđƴ ƴѣџʙѧϯƀ ϯѧκ κѧκ ѳʜѧ ʜџ ʜѧ ӌϯѳ ʜє ҁπѳҁѳѣʜѧᴙ ɯʌѥχѧ κѳϯѳⱀѧᴙ ѣєⱀёϯ ʍѳѥ ҁπєⱀʍƴ ʙ ⱀѳϯ ϯƀӀ ѫє ƴʍѳʌєɯѳʜʜѧᴙ χƴєҁѳҁκѧ ѣѳӣҁᴙ ʍєʜᴙ џʌџ ᴙ ʜѧӌʜƴ đѳʌѣџϯƀ ϯʙѳӣ џҁϯєⱀӡѧʜʜƀӀӣ ⱀѳϯ ʍѳџʍ χƴєʍ ƴѣџϯƀӀӣ ʍѳєӣ ҁπєⱀʍѳӣ ϯƀӀ ѫє ҁʌѧѣѧᴙ ѫѧʌκѧᴙ χƴӣʜᴙ κѳϯѳⱀѧᴙ ʍʜѳґѳ ӡѧʌƴπѧєϯҁᴙ ʜѧ ʍѳӣ ӌʌєʜ ϯƀӀ ѫє đѳχʌƀӀӣ ʍџⱀʜᴙκ єѣѧʜѧᴙ ⱀƴҁʜᴙ ʜє πʌѧӌƀ ϯƴϯ ѧ ⱀєѱє ѣєⱀџ ʍѳӣ ӌʌєʜ ʜѧ ҁʙѳӣ єѣƴӌџӣ ϯѳѱџӣ ʜџκѳʍƴ ʜє ʜƴѫʜƀӀӣ ⱀѳϯѧʜ ϯєⱀπџʌџӡџⱀѳʙѧʜʜƀӀӣ ҁƀӀʜѳκ ѣʌєʙѳϯʜџ ⟨<emoji document_id=5238108342873762772>🦎</emoji><emoji document_id=5379716300840902598>💚</emoji>-[<emoji document_id=5323735495241377106>🐊</emoji>]-|<emoji document_id=5190406357320216268>🦠</emoji><emoji document_id=5370874247373660919>💸</emoji>|<emoji document_id=5449523005598210324>🌲</emoji>|",
